    false,nt"url": null,nt"notes": "This dataset consists of a workspace (folder)
    containing 41 gridded datasets and a personal geodatabase. The gridded datasets
    consist of 28 precipitation-frequency grids, a mean annual precipitation grid, eight
    land cover grids, two soil permeability grids, a synthetic stream grid, and a region
    grid used in the Hawaii StreamStats application for peak flow estimates. The personal
    geodatabase contains a polygon feature class of exclusion polygons, which identify
    areas in which use the StreamStats application is restricted.",nt"license_title":
